use tokio::net::{TcpListener, TcpStream};
use tokio::io::{AsyncWriteExt,AsyncReadExt};
use std::str::FromStr;
use uuid::Uuid;

// constants
const KARIN_SERVER_ADDRESS: &str = "127.0.0.1:8001";
const SIROCCO_SERVER_ADDRESS: &str = "127.0.0.1:8000";

#[tokio::main]
async fn main() {
    // starting
    println!("karin starting {}", KARIN_SERVER_ADDRESS);

    // bind
    let listener = TcpListener::bind(KARIN_SERVER_ADDRESS).await.unwrap();

    // starting
    println!("karin listening {}", KARIN_SERVER_ADDRESS);

    // loop through incoming connections
    loop {
        // accept the connection
        let (socket, _) = listener.accept().await.unwrap();

        tokio::spawn(async move {
            handle_connection(socket).await;
        });
    }
}

async fn handle_connection(mut stream: TcpStream) {
    // create uuid
    let id = Uuid::new_v4();

    // create the buffer
    let mut buffer = [0; 1024];

    // read the stream
    let len = stream.read(&mut buffer).await.unwrap();

    // output the request
    let message = String::from_utf8_lossy(&buffer[..len]);
    println!("{} - received: {}", id, message);

    // call sirocco
    let sirocco_message = call_sirocco(id, message.to_owned().to_string()).await;
    let output = format!("sirocco says: {}", sirocco_message);

    // send out message
    let _ = stream.write_all(output.as_bytes()).await;
    println!("{} - sent: {}", id, message);
}

async fn call_sirocco(id:Uuid, message: String) -> String {
    // connecting
    println!("{} - connecting to sirocco: {}",id, SIROCCO_SERVER_ADDRESS);

    // connected
    if let Ok(mut stream) = TcpStream::connect(SIROCCO_SERVER_ADDRESS).await {
        // connected message
        println!(
            "{} - connected to sirocco: {}:{}",
            id,
            stream.local_addr().unwrap().ip(),
            stream.local_addr().unwrap().port()
        );

        // set our message as hello world
        let _ = stream.write_all(message.as_bytes()).await;
        println!("{} - sent: {}", id, message);

        // read the result
        let mut buffer = [0; 1024];
        let len = stream.read(&mut buffer).await.unwrap();
        let message = String::from_utf8_lossy(&buffer[..len]); 
        println!("{} - received from sirocco: {}", id, message);

        // return the message
        return message.to_owned().to_string();
    } else {
        println!(
            "{} - couldn't connect to sirocco: {}",
            id,
            SIROCCO_SERVER_ADDRESS
        );

        // sirocco is not available
        return String::from_str("sirocco is not available").unwrap();
    }
}

use futures_util::{StreamExt, SinkExt, stream::{SplitSink, SplitStream}};
use tokio::io::{AsyncRead, AsyncWrite};
use tokio::io::{self, AsyncBufReadExt};
use tokio_tungstenite::{connect_async, tungstenite::Message, WebSocketStream};

async fn register_bot(write: &mut SplitSink<WebSocketStream<impl AsyncRead + AsyncWrite + Unpin>, Message>, bot_name: &str) {
    let registration_message = Message::Text(format!("register as {}", bot_name));
    write.send(registration_message).await.expect("Failed to send registration message");
}

async fn handle_incoming_messages(mut read: SplitStream<WebSocketStream<impl AsyncRead + AsyncWrite + Unpin>>) {
    while let Some(message) = read.next().await {
        match message {
            Ok(msg) => println!("Received a message: {}", msg),
            Err(e) => eprintln!("Error receiving message: {}", e),
        }
    }
}

async fn read_and_send_messages(mut write: SplitSink<WebSocketStream<impl AsyncRead + AsyncWrite + Unpin>, Message>) {
    let mut reader = io::BufReader::new(io::stdin()).lines();
    while let Some(line) = reader.next_line().await.expect("Failed to read line") {
        if !line.trim().is_empty() {
            write.send(Message::Text(line)).await.expect("Failed to send message");
        }
    }
}


